import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

const API = 'https://sheets.googleapis.com/v4/spreadsheets/1JbLq-KRysRSD6Xptw24p3I79takWfFwCTSY7nYbakPI/values:batchGet?ranges=Investment!B3:B7&majorDimension=ROWS&key=AIzaSyBhw79t2J0aRVOT2a0P0-Jh81TvwhK0VMI';

class App extends Component {

  constructor(){
    super();

    this.state = {
     items:[]
    };

  }


  componentDidMount(){

     fetch(API).then(response => response.json()).then(data => {
      let batchRowValues = data.valueRanges[0].values;

      const rows = [];
      for (let i = 1; i < batchRowValues.length; i++) {
        let rowObject = {};
        for (let j = 0; j < batchRowValues[i].length; j++) {
          rowObject[batchRowValues[0][j]] = batchRowValues[i][j];
        }
        rows.push(rowObject);
      }

        this.setState({ items: rows });
        console.log(this.state.items);
    });

  }
  render() {
    const listItems = this.state.items.map((item) =>
    <li>{item.name} at Latitute {item.lat} and Longitude {item.lng} </li>
  );

    return (
      <div>
         <ul>{listItems}</ul>
      </div>
    );
  }
}

export default App;
